        CASE
            WHEN (date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) < (1)::double precision) THEN 'a.[<1yrs]'::text
            WHEN ((date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) >= (1)::double precision) AND (date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) <= (4)::double precision)) THEN 'b.[1-4yrs]'::text
            WHEN ((date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) >= (5)::double precision) AND (date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) <= (9)::double precision)) THEN 'c.[5-9yrs]'::text
            WHEN ((date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) >= (10)::double precision) AND (date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) <= (14)::double precision)) THEN 'd.[10-14yrs]'::text
            WHEN ((date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) >= (15)::double precision) AND (date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) <= (17)::double precision)) THEN 'e.[15-17yrs]'::text
            WHEN ((date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) >= (18)::double precision) AND (date_part('year'::text, age('2022-03-31 00:00:00'::timestamp without time zone, (reg_person.date_of_birth)::timestamp without time zone)) <= (20)::double precision)) THEN 'f.[18-20yrs]'::text
