    ovc_facility.facility_code AS facility_mfl_code,
    ovc_care_health.date_linked AS date_of_linkage,
    ovc_care_health.ccc_number,
        CASE
            WHEN (date_part('day'::text, ((CURRENT_DATE)::timestamp without time zone - (ovc_care_health.date_linked)::timestamp without time zone)) < (91)::double precision) THEN '0-3 Months'::text
            WHEN ((date_part('day'::text, ((CURRENT_DATE)::timestamp without time zone - (ovc_care_health.date_linked)::timestamp without time zone)) > (90)::double precision) AND (date_part('day'::text, ((CURRENT_DATE)::timestamp without time zone - (ovc_care_health.date_linked)::timestamp without time zone)) < (181)::double precision)) THEN '3-6 Months'::text
